import React from "react";

type PropsType = {
  title: string;
  location: string;
  date: string;
  details: string;
};

const Entry = ({ title, location, date, details }: PropsType) => {
  <div>
    <div>
      <h3>{title}</h3>
      <h4>{location}</h4>
      <p>{date}</p>
    </div>
    <div>
      <p>{details}</p>
    </div>
  </div>;
};

export default Entry;
